Earth (Blu-ray)

Nature Documentary hosted by James Earl Jones, published by Disneynature in 2008 - English narration


Information
------------------------------

Earth (Blu-ray) 
An epic story of adventure, starring some of the most magnificent and courageous creatures alive, awaits you in Earth. Disneynature brings you a remarkable story, narrated by James Earl Jones, of three animal families on a journey across our planet - polar bears, elephants and humpback whales.
This is an excellent companion to the BBC's Blu-ray version of Planet Earth. The presentation is different - and in some respects better. The quality of the camera work is equal to that of Planet Earth. A very worthy addition to a Blu-ray documentary collection.

